import React, { useState } from 'react';
import { useNavigate } from 'react-router-dom';
import { Card, CardContent } from './ui/card';
import { UserPlus, User, Mail, Phone, Building, LogIn, Lock } from 'lucide-react';
import Header from './Header';

const Signup = () => {
  const [formData, setFormData] = useState({
    firstName: '',
    lastName: '',
    email: '',
    phone: '',
    company: '',
    password: '',
    confirmPassword: ''
  });
  const [hoveredField, setHoveredField] = useState(null);

  const navigate = useNavigate();

  const handleChange = (e) => {
    setFormData({
      ...formData,
      [e.target.name]: e.target.value
    });
  };

  const getLabelColor = (fieldName) => {
    if (hoveredField === fieldName) {
      return 'text-transparent bg-clip-text bg-gradient-to-r from-purple-400 to-pink-600';
    }
    return 'text-white/70';
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    if (formData.password !== formData.confirmPassword) {
      alert("Passwords don't match!");
      return;
    }
    // For now, just redirect to home page
    navigate('/');
  };

  return (
    <div className="min-h-screen bg-slate-900 text-white pt-4 px-8 relative overflow-hidden group/bg">
      {/* Interactive background elements */}
      <div className="fixed inset-0 transition-all duration-700 group-hover/bg:backdrop-blur-sm">
        <div className="absolute inset-0 opacity-20 group-hover/bg:opacity-30 transition-opacity duration-700">
          <div className="absolute top-0 -left-4 w-96 h-96 bg-purple-500 rounded-full mix-blend-multiply filter blur-xl animate-blob"></div>
          <div className="absolute top-0 -right-4 w-96 h-96 bg-indigo-500 rounded-full mix-blend-multiply filter blur-xl animate-blob animation-delay-2000"></div>
          <div className="absolute -bottom-8 left-20 w-96 h-96 bg-pink-500 rounded-full mix-blend-multiply filter blur-xl animate-blob animation-delay-4000"></div>
        </div>
      </div>

      <div className="max-w-6xl mx-auto relative mt-16">
        {/* Content */}
        <div className="bg-slate-800/50 backdrop-blur-md rounded-2xl p-8 shadow-xl border border-slate-700/30">
          <Header badgeText="Create Account" />

          <div className="mt-12 flex justify-center">
            <div className="w-[500px]">
              <Card className="bg-slate-800/30 backdrop-blur-sm shadow-lg hover:shadow-xl transition-all duration-200 border border-slate-700/30">
                <CardContent className="p-5">
                  <div className="flex flex-col items-center justify-center mb-6">
                    <div className="p-4 rounded-full bg-gradient-to-r from-purple-500/20 to-pink-500/20 backdrop-blur-sm border border-slate-700/30 shadow-lg group hover:shadow-purple-500/10 transition-all duration-300">
                      <UserPlus className="w-8 h-8 text-transparent bg-clip-text bg-gradient-to-r from-purple-400 to-pink-500 group-hover:scale-110 transition-transform duration-300" />
                    </div>
                    <h2 className="text-2xl font-bold text-center mt-4 mb-1 text-transparent bg-clip-text bg-gradient-to-r from-purple-400 to-pink-500">Create Your Account</h2>
                    <p className="text-sm text-white/50">Join AuthentiScan to get started</p>
                  </div>
                  <form onSubmit={handleSubmit} className="space-y-4">
                    <div className="grid grid-cols-2 gap-4">
                      <div>
                        <label 
                          className={`block text-sm font-medium mb-1 transition-colors duration-200 ${getLabelColor('firstName')}`}
                          onMouseEnter={() => setHoveredField('firstName')}
                          onMouseLeave={() => setHoveredField(null)}
                        >
                          First Name
                        </label>
                        <div className="relative">
                          <div className="absolute inset-y-0 left-0 pl-3 flex items-center pointer-events-none group">
                            <User className="h-4 w-4 text-transparent bg-clip-text bg-gradient-to-r from-purple-400 to-pink-500" />
                          </div>
                          <input
                            type="text"
                            name="firstName"
                            value={formData.firstName}
                            onChange={handleChange}
                            className="w-full pl-9 pr-3 py-2 rounded-lg bg-slate-800/20 border border-slate-700/30 text-white placeholder-white/50 focus:outline-none focus:ring-2 focus:ring-indigo-500"
                            required
                          />
                        </div>
                      </div>
                      <div>
                        <label 
                          className={`block text-sm font-medium mb-1 transition-colors duration-200 ${getLabelColor('lastName')}`}
                          onMouseEnter={() => setHoveredField('lastName')}
                          onMouseLeave={() => setHoveredField(null)}
                        >
                          Last Name
                        </label>
                        <div className="relative">
                          <div className="absolute inset-y-0 left-0 pl-3 flex items-center pointer-events-none group">
                            <User className="h-4 w-4 text-transparent bg-clip-text bg-gradient-to-r from-purple-400 to-pink-500" />
                          </div>
                          <input
                            type="text"
                            name="lastName"
                            value={formData.lastName}
                            onChange={handleChange}
                            className="w-full pl-9 pr-3 py-2 rounded-lg bg-slate-800/20 border border-slate-700/30 text-white placeholder-white/50 focus:outline-none focus:ring-2 focus:ring-indigo-500"
                            required
                          />
                        </div>
                      </div>
                    </div>
                    <div>
                      <label 
                        className={`block text-sm font-medium mb-1 transition-colors duration-200 ${getLabelColor('email')}`}
                        onMouseEnter={() => setHoveredField('email')}
                        onMouseLeave={() => setHoveredField(null)}
                      >
                        Email
                      </label>
                      <div className="relative">
                        <div className="absolute inset-y-0 left-0 pl-3 flex items-center pointer-events-none group">
                          <Mail className="h-4 w-4 text-transparent bg-clip-text bg-gradient-to-r from-purple-400 to-pink-500" />
                        </div>
                        <input
                          type="email"
                          name="email"
                          value={formData.email}
                          onChange={handleChange}
                          className="w-full pl-9 pr-3 py-2 rounded-lg bg-slate-800/20 border border-slate-700/30 text-white placeholder-white/50 focus:outline-none focus:ring-2 focus:ring-indigo-500"
                          required
                        />
                      </div>
                    </div>
                    <div>
                      <label 
                        className={`block text-sm font-medium mb-1 transition-colors duration-200 ${getLabelColor('phone')}`}
                        onMouseEnter={() => setHoveredField('phone')}
                        onMouseLeave={() => setHoveredField(null)}
                      >
                        Phone Number
                      </label>
                      <div className="relative">
                        <div className="absolute inset-y-0 left-0 pl-3 flex items-center pointer-events-none group">
                          <Phone className="h-4 w-4 text-transparent bg-clip-text bg-gradient-to-r from-purple-400 to-pink-500" />
                        </div>
                        <input
                          type="tel"
                          name="phone"
                          value={formData.phone}
                          onChange={handleChange}
                          className="w-full pl-9 pr-3 py-2 rounded-lg bg-slate-800/20 border border-slate-700/30 text-white placeholder-white/50 focus:outline-none focus:ring-2 focus:ring-indigo-500"
                          required
                        />
                      </div>
                    </div>
                    <div>
                      <label 
                        className={`block text-sm font-medium mb-1 transition-colors duration-200 ${getLabelColor('company')}`}
                        onMouseEnter={() => setHoveredField('company')}
                        onMouseLeave={() => setHoveredField(null)}
                      >
                        Company
                      </label>
                      <div className="relative">
                        <div className="absolute inset-y-0 left-0 pl-3 flex items-center pointer-events-none group">
                          <Building className="h-4 w-4 text-transparent bg-clip-text bg-gradient-to-r from-purple-400 to-pink-500" />
                        </div>
                        <input
                          type="text"
                          name="company"
                          value={formData.company}
                          onChange={handleChange}
                          className="w-full pl-9 pr-3 py-2 rounded-lg bg-slate-800/20 border border-slate-700/30 text-white placeholder-white/50 focus:outline-none focus:ring-2 focus:ring-indigo-500"
                          required
                        />
                      </div>
                    </div>
                    <div>
                      <label 
                        className={`block text-sm font-medium mb-1 transition-colors duration-200 ${getLabelColor('password')}`}
                        onMouseEnter={() => setHoveredField('password')}
                        onMouseLeave={() => setHoveredField(null)}
                      >
                        Password
                      </label>
                      <div className="relative">
                        <div className="absolute inset-y-0 left-0 pl-3 flex items-center pointer-events-none group">
                          <Lock className="h-4 w-4 text-transparent bg-clip-text bg-gradient-to-r from-purple-400 to-pink-500" />
                        </div>
                        <input
                          type="password"
                          name="password"
                          value={formData.password}
                          onChange={handleChange}
                          className="w-full pl-9 pr-3 py-2 rounded-lg bg-slate-800/20 border border-slate-700/30 text-white placeholder-white/50 focus:outline-none focus:ring-2 focus:ring-indigo-500"
                          required
                        />
                      </div>
                    </div>
                    <div>
                      <label 
                        className={`block text-sm font-medium mb-1 transition-colors duration-200 ${getLabelColor('confirmPassword')}`}
                        onMouseEnter={() => setHoveredField('confirmPassword')}
                        onMouseLeave={() => setHoveredField(null)}
                      >
                        Confirm Password
                      </label>
                      <div className="relative">
                        <div className="absolute inset-y-0 left-0 pl-3 flex items-center pointer-events-none group">
                          <Lock className="h-4 w-4 text-transparent bg-clip-text bg-gradient-to-r from-purple-400 to-pink-500" />
                        </div>
                        <input
                          type="password"
                          name="confirmPassword"
                          value={formData.confirmPassword}
                          onChange={handleChange}
                          className="w-full pl-9 pr-3 py-2 rounded-lg bg-slate-800/20 border border-slate-700/30 text-white placeholder-white/50 focus:outline-none focus:ring-2 focus:ring-indigo-500"
                          required
                        />
                      </div>
                    </div>
                    <button
                      type="submit"
                      className="w-full flex items-center justify-center space-x-2 text-sm text-white hover:text-indigo-200 font-medium tracking-wide px-4 py-2 rounded-lg bg-slate-800/20 hover:bg-slate-700/30 transition-colors duration-200 border border-slate-700/30"
                    >
                      Create Account
                    </button>
                  </form>
                  <p className="mt-6 text-center">
                    <a 
                      href="/login" 
                      className="group inline-flex items-center gap-2 text-sm hover:scale-105 transition-all duration-200"
                    >
                      <span className="text-white/70">Already have an account?</span>
                      <span className="inline-flex items-center gap-1.5 text-indigo-400 hover:text-indigo-300 font-medium">
                        Login
                        <LogIn 
                          className="w-4 h-4 transition-transform duration-200 group-hover:rotate-12" 
                          strokeWidth={2.5}
                        />
                      </span>
                    </a>
                  </p>
                </CardContent>
              </Card>
            </div>
          </div>
        </div>
      </div>

      {/* Footer */}
      <div className="max-w-6xl mx-auto relative mt-8 mb-4">
        <div className="bg-slate-800/30 backdrop-blur-sm rounded-xl p-4 shadow-xl border border-slate-700/30">
          <div className="text-center text-sm text-gray-400">
            <p>© {new Date().getFullYear()} AuthentiScan. All rights reserved.</p>
          </div>
        </div>
      </div>
    </div>
  );
};

export default Signup;
